import ExpenseItem from "./components/ExpenseItem";
function App() {
  const expenses = [
    { title: "Car Title", date: new Date(2021, 2, 28), amount: 284.64 },
    { title: "Food", date: new Date(2021, 2, 28), amount: 284.64 },
    { title: "Gas", date: new Date(2021, 2, 28), amount: 284.64 },
  ];

  return (
    <div>
      <h2>Lets get started!</h2>
      <ExpenseItem expense={expenses[0]}/>
      <ExpenseItem expense={expenses[1]}/>
      <ExpenseItem expense={expenses[2]}/>
    </div>
  );
}

export default App;
